import React, { useState, useEffect } from 'react';
import axios from '../axios';
import './App.css';

function App() {
  const [data, setData] = useState({ hits: [] });
  useEffect(async () => {
    const result = await axios(
      'http://localhost:3000/Role',
    );
    setData(result.data);
  }, []);


  return (
    <div className="App">
      {console.log(data)}
    </div>
  );
}

export default App;
